import React, { Component } from 'react';
import './Weather.css';

class Weather extends Component{
    render(){
        return(
            <div class="weather-container">
                <span class="weather">
                    날씨
                </span>
                <span class="dust">
                    미세먼지
                </span>
            </div>
        )
    }
};

export default Weather;
